import React from 'react'
import ReactDOM from 'react-dom'

import {data} from '../components/DownloadData'



class Test extends React.Component {
	render() {
		console.log(data);

		return (
			<div>{data}</div>
		)
	}
}

function YO() {
	return (
		<Test />
	)
}

export default YO
